}

.food-category button:hover,
.food-category button.active {
	background-color: var(--primary-color);
	color: var(--white);
}

.food-item-wrap {
	display: flex;
	flex-wrap: wrap;
	justify-content: flex-start;
	margin-top: 3rem;
}

.food-item {
	width: 25%;
	height: 30rem;
	padding: 1rem;
}

.item-wrap {
	height: 100%;
	transition: .4s ease-in-out;
	cursor: pointer;
	border-radius: 2rem;
}

.item-wrap:hover {
	box-shadow: rgba(14, 30, 37, 0.12) 0px 2px 4px 0px, rgba(14, 30, 37, 0.32) 0px 2px 16px 0px;
}

.item-img {
	height: 60%;
	position: relative;
	overflow: hidden;
	border-radius: 2rem;
}

.img-holder {
	position: absolute;
	top: 0;
	left: 0;
	width: 100%;
	height: 100%;
	transition: .5s ease-in-out;
	border-radius: 2rem;
