	background-color: var(--white);
	border-radius: 3rem;
	box-shadow: rgba(100, 100, 111, 0.2) 0px 7px 29px 0px;
}

.review-wrap.active {
	transform: scale(1.2) !important;
}

.review-content {
	padding: 3rem;
	border-bottom: .125rem solid var(--grey);
	position: relative;
	text-align: center;
}

