	display: flex;
	justify-content: space-between;
	margin-top: 2rem;
}

.input-group input {
	flex: auto;
	outline: none;
	border: none;
	color: var(--primary-color);
	background-color: transparent;
}

.input-group button {
	padding: .5rem 1rem;
	outline: none;
	border: none;
	background-color: var(--primary-color);
	border-radius: 1rem;
	color: var(--white);
	font-weight: 600;
	cursor: pointer;
