	transform: translateX(-150%);
	transition: 1s ease-in-out;
}

.left-to-right.start {
	transform: translateX(0);
}

.right-to-left {
	transform: translateX(150%);
	transition: 1s ease-in-out;
}

.right-to-left.start {
	transform: translateX(0);
